<?PHP exit;?>	1456585819	admin	1	222.128.130.21	plugins	GET={operation=config; do=13; identifier=tom_weixin; pmod=module; act=admin; moduleid=submenu; mact=edit; id=6; title=如何在极拼商城上拼团？; description=各位亲爱的极拼团长、团员们：  极拼商城是社群经济+拼团模式于一体的新兴购物平台，以经营高品质进口商品为主，采用多级拼团模式，参团人数越多价格越低，很多商品给极拼团长设置了额外优惠。  极拼商城上的商家都是经过我们经过精挑细选的资质齐全的公司商家，所选商品都是在保证质量前提下给出的最优价格，甚至有的商品低于成本价。极拼团员们可以买到真正放心的低价正品。  购买商品的方式：  1.单独购买：  优点：即时成交，不用等待其他团员拼团，可尽快收到商品。  缺点：成交价格较高，未享受到更多的优惠和拼团的乐趣。  2.当极拼团长：  优点：许多商品设置了团长专享价，可以享受更多的优惠。极拼商城会不定期评选最佳团长，给予额外的现金或实物奖励。同时可以培养自己的组织号召能力。  缺点：需要去寻找志同道合的团员，需具备一定的责任感和分享精神。  3.当极拼团员：  优点：只需参加极拼团长已开的团即可，搭顺风车。  缺点：享受不到为团长专设的优惠。  4.拼团不成功：  若到达指定时间未成团，您已支付的款项会自动原路径退回您的微信钱包或银行卡。; picurl=http://www.1jipin.com/data/attachment/image/640.jpg; url=https://mp.weixin.qq.com/s?__biz=MzIzMDE1OTk2OQ==&amp;mid=402244586&amp;idx=1&amp;sn=3f18347a9af71dd829347b5194f5ed1f&amp;scene=0&amp;key=710a5d99946419d9d39d1d66aa8d60479e2bea38a27a1e089f8424ff35e62d6401baf66c99f889c3d0a668b2f3ed7ef3&amp;ascene=1&amp;uin=MTMwMTg5NTM2NA%3D%3D&amp;devicetype=Windows-QQBrowser&amp;version=61030003&amp;pass_ticket=zfAzSKa0RMDs4aP8RNClyFv22%2BbfeIdWxEc9HBJvfRyeDUHAIX2SWwnCk9kre6F4; paixu=10; }; POST={title=如何在极拼商城上拼团？; description=各位亲爱的极拼团长、团员们：  极拼商城是社群经济+拼团模式于一体的新兴购物平台，以经营高品质进口商品为主，采用多级拼团模式，参团人数越多价格越低，很多商品给极拼团长设置了额外优惠。  极拼商城上的商家都是经过我们经过精挑细选的资质齐全的公司商家，所选商品都是在保证质量前提下给出的最优价格，甚至有的商品低于成本价。极拼团员们可以买到真正放心的低价正品。  购买商品的方式：  1.单独购买：  优点：即时成交，不用等待其他团员拼团，可尽快收到商品。  缺点：成交价格较高，未享受到更多的优惠和拼团的乐趣。  2.当极拼团长：  优点：许多商品设置了团长专享价，可以享受更多的优惠。极拼商城会不定期评选最佳团长，给予额外的现金或实物奖励。同时可以培养自己的组织号召能力。  缺点：需要去寻找志同道合的团员，需具备一定的责任感和分享精神。  3.当极拼团员：  优点：只需参加极拼团长已开的团即可，搭顺风车。  缺点：享受不到为团长专设的优惠。  4.拼团不成功：  若到达指定时间未成团，您已支付的款项会自动原路径退回您的微信钱包或银行卡。; picurl=http://www.1jipin.com/data/attachment/image/640.jpg; url=https://mp.weixin.qq.com/s?__biz=MzIzMDE1OTk2OQ==&amp;mid=402244586&amp;idx=1&amp;sn=3f18347a9af71dd829347b5194f5ed1f&amp;scene=0&amp;key=710a5d99946419d9d39d1d66aa8d60479e2bea38a27a1e089f8424ff35e62d6401baf66c99f889c3d0a668b2f3ed7ef3&amp;ascene=1&amp;uin=MTMwMTg5